--
-- Name: audit(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION audit() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF (TG_OP = 'DELETE') THEN
            RETURN OLD;
        ELSIF (TG_OP = 'UPDATE') THEN
            RETURN NEW;
        ELSIF (TG_OP = 'INSERT') THEN
            RETURN NEW;
        END IF;
END;
$$;


ALTER FUNCTION public.audit() OWNER TO postgres;

--
-- Name: insert_padre(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION insert_padre() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
 IF TG_OP='INSERT' THEN
  UPDATE bienes	
   SET bien_padre=NEW.id_bien
   WHERE id_bien=NEW.id_bien AND (id_desc=12 OR id_desc=11 OR id_desc=16 OR id_desc=25);
 END IF;
 RETURN NULL;
END;
$$;


ALTER FUNCTION public.insert_padre() OWNER TO postgres;

--
-- Name: insert_tras(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION insert_tras() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
IF TG_OP='INSERT' THEN 
  update traslados
  set ultimo='no' where bien_id=new.bien_id and fec_traslado<new.fec_traslado;
END IF;
 return null;
END;$$;


ALTER FUNCTION public.insert_tras() OWNER TO postgres;

--
-- Name: up_estado(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION up_estado(id_bien integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
BEGIN
        UPDATE bienes
        SET id_estado = '2'
        WHERE bien_padre = $1;
        RETURN 0;
END;
$_$;


ALTER FUNCTION public.up_estado(id_bien integer) OWNER TO postgres;

